import React from "react";
import "../App.css";
import Introduction from "../components/introduction";
import Firstpage from "../components/firstpage";
import Contactus from "../components/contactus";
import { FullPage, Slide } from "react-full-page";

const Home = () => {
  return (
    <>
      <FullPage controls>
        <Slid>
          <Firstpage />
        </Slid>
        <Slid>
          <Introduction />
        </Slid>
        <Slid>
          <Contactus />
        </Slid>
      </FullPage>
    </>
  );
};

export default Home;
